import DarrowIcon from "../icons/darrow";

function Menu() {
  const position = {
    label: "flex gap-2 relative",
    dropdown: "absolute w-36 right-0",
  };
  const design = { text: "font-light tracking-wide cursor-pointer" };

  return (
    <>
      <div className={position.label}>
        <h2 className={design.text}>Sort</h2>
        <DarrowIcon />
      </div>
      <div className={position.dropdown}>
        <p className={design.text}>Newest</p>
        <p className={design.text}>Price: High to Low</p>
        <p className={design.text}>Price: Low to High</p>
      </div>
    </>
  );
}

export default Menu;
